import './Main.css';

import { Col, Container, Row } from "react-bootstrap";

function Main(){
    return(
        <Container fluid>
            <div className = "main-wrapper">
                <Row>
                    <Col lg = "3" md = "6" sm = "12">
                        <div className='main-content'>

                        </div>
                    </Col>
                </Row>
            </div>
        </Container>
    )
}
export default Main
